import React, { Component } from 'react';
import axios from 'axios';

class LeaderboardContainer extends Component {
	constructor(props) {
		super(props);

		this.state = {
			scores: [],
			isLoading: true
		}
	}

	componentWillMount() {
		const game_name = this.props.match.params.game_name;


	}

	render() {
		return (
			<div></div>
		);
	}
}

export default LeaderboardContainer;
